import "./W3.css";

function MenuImagePad(props) {
  const data = props.imagePadData;
  const image = require('./Logo.png')
  console.log(data);
  const classes = "w3-padding-64 " + props.className;
  return (
    <div className={classes}>
      <h1>{data.header}</h1>
      <img src={image.default} alt={data.imageAlt} style={{ width: "65%" }} />
      <button class="w3-button w3-black w3-round-xxlarge w3-hover-khaki">
        {data.buttonText}
      </button>
      {props.children}
    </div>
  );
}
export default MenuImagePad;
